    const Text = require('./text')

    for (const instance of this._pageNumbers) {
      let withPageCount = false
      if (instance.fn) {
        const lhs = instance.fn(1, 1)
        const rhs = instance.fn(1, 10)
        withPageCount = lhs.length !== rhs.length
      }

