        this._cursor.bottomOffset = -this._doc._cursor.bottomOffset

        const txt = new Text(this._doc, this, instance.opts)
        txt._parts++
        txt._ended = true
        await txt._start()
        await txt._render(String(this._doc._pages.length), instance.opts)
